import Asset1 from '../../assets/Imagenes/Contacto/Asset1.png';
import styles from './Contacto.module.css';


const Contacto = () => {
    return (
        <div className={styles.container}>
            <img className={styles.image} src={Asset1} alt='Imagen contacto'></img>
            <div className={styles.containerpara}>
                <p className={styles.contact}>contact</p>
                <p>Photographer <span className={styles.low}>& Director</span></p>
                <p><a href="mailto:andysucari@hotmail.com?Subject=Consultas">andysucari@hotmail.com</a></p>

                <p><a class="whatsappLink desktop" href="http://web.whatsapp.com/send?phone=+5491151088995">11-5108-8995</a></p>
                <p><a href="https://instagram.com/andysucari?utm_medium=copy_link">ig</a></p>
            </div>
        </div>
    )
};

export default Contacto;
